import React from 'react';
import '../MyInfo.css';

import Img from '../../../../assets/miclaude.png';
import { BiImageAdd } from 'react-icons/bi'

const PhotoUser = () => {
    return (
        <div className="BlockContainer">
            <div className="TitleBackground">
                <h4 className='h4'>Image Profil</h4>
            </div>
            <div className="BlockImage">
                <img src={Img} className='Img'alt=''/>
                <div style={{border:'1px solid black', cursor:'pointor', display:'flex', justifyContent:'center', alignItems:'center',position:'relative', width:'40px', height: '40px', backgroundColor:'yellow', top:'85px', right:'60px', borderRadius:'50%'}}>
                <BiImageAdd style={{width:'35px', height: '35px', color:'black'}}/>
                </div>


            </div>
        </div>
    )
}

export default PhotoUser;
